import React from 'react';

import './Toolbar.css';

import DrawerToggle from '../Navigation/SideDrawer/DrawerToggle/DrawerToggle';

import MainNavigation from '../Navigation/MainNavigation/MainNavigation';
import MobileNavigation from '../Navigation/MobileNavigation/MobileNavigation';

const Toolbar = (props) => {
  if (props.token) {
    return 'dummy';
  }

  return (
    <React.Fragment>
      <header className="main-header">
        <DrawerToggle clicked={props.drawerToggleClicked}></DrawerToggle>
        <MainNavigation cart={props.cart}></MainNavigation>
        <svg id="svg2" viewBox="0 0 512 512">
              <path
                className="s-logo"
                d="m 151.02735,283.40585 c -0.0579,4.95679 0.27641,14.40523 1.08141,18.96323 2.703,15.295 7.62757,28.625 20.14157,38.1 30.086,22.779 75.2857,23.14837 110.6407,15.35137 16.022,-3.534 32.662,-10.038 43.816,-22.58 17.413,-19.581 19.581,-57.623 -1.831,-75.188 -13.78263,-11.30709 -47.42244,-17.2566 -81.3387,-21.13579 -32.22997,-3.68632 -64.70959,-5.50306 -80.63595,-8.27115 -13.899,-2.416 -16.26523,-48.79633 -9.07002,-63.46971 7.19521,-14.67338 29.95046,-28.399 40.87429,-33.06373 15.1383,-6.46441 30.44694,-11.54241 50.86031,-12.43205 35.46153,-1.54547 74.74331,20.54624 74.74331,20.54624 0,0 17.40586,9.49729 22.434,21.66376 5.02814,12.16647 3.72595,30.83032 3.72595,30.83032"
                style={{
                  fill: 'none',
                  stroke: '#8cc74e',
                  strokeOpacity: 1,
                }}
                id="path984"
              />
            </svg>
      </header>
      <MobileNavigation
        cart={props.cart}
        navOpen={props.navOpen}
        onChooseItem={props.onChooseItem}
      ></MobileNavigation>
    </React.Fragment>
  );
};

export default Toolbar;
